import React, { useState, useEffect } from 'react';
import { Container, Box, AppBar, Toolbar, IconButton, Typography, Tabs, Tab, useTheme, ThemeProvider, CssBaseline } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { Provider } from 'react-redux';
import { store } from './store/index';
import { theme } from './theme';
import { AccessTokenInput } from './components/Auth/AccessTokenInput';
import { useAuth } from './hooks/useAuth';
import { OptionChainGrid } from './components/OptionChain/OptionChainGrid';
import { TradeSummary } from './components/Trade/TradeSummary';
import { VolatilityAnalysis } from './components/Analysis/VolatilityAnlaysis';
import { StrategyBuilder } from './components/Strategy/StrategyBuilder';

interface TabPanelProps {
  children?: React.ReactNode;
  index: number;
  value: number;
}

function TabPanel(props: TabPanelProps) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`tabpanel-${index}`}
      aria-labelledby={`tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          {children}
        </Box>
      )}
    </div>
  );
}

function AppContent() {
  const [value, setValue] = useState(0);
  const { isAuthenticated } = useAuth();
  const theme = useTheme();

  // Redirect to access token tab if not authenticated
  useEffect(() => {
    if (!isAuthenticated) {
      setValue(4); // Access Token tab index
    }
  }, [isAuthenticated]);

  const handleChange = (event: React.SyntheticEvent, newValue: number) => {
    // Only allow changing tabs if authenticated or going to access token tab
    if (isAuthenticated || newValue === 4) {
      setValue(newValue);
    }
  };

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" color="primary">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1, fontWeight: 'bold' }}>
            KAVAS CAPITAL
          </Typography>
        </Toolbar>
      </AppBar>
      <Box sx={{ borderBottom: 1, borderColor: 'divider', bgcolor: 'background.paper' }}>
        <Tabs 
          value={value} 
          onChange={handleChange} 
          aria-label="trading tabs"
          variant="scrollable"
          scrollButtons="auto"
          sx={{
            '& .MuiTab-root': {
              fontWeight: 'bold',
              fontSize: '0.9rem',
              minWidth: 120,
            }
          }}
        >
          <Tab label="Option Chain" disabled={!isAuthenticated} />
          <Tab label="Trade Summary" disabled={!isAuthenticated} />
          <Tab label="Volatility Analysis" disabled={!isAuthenticated} />
          <Tab label="Strategy Builder" disabled={!isAuthenticated} />
          <Tab label="Access Token" />
        </Tabs>
      </Box>

      <Box sx={{ mt: 2 }}>
        <TabPanel value={value} index={0}>
          {isAuthenticated && <OptionChainGrid symbol="NIFTY" />}
        </TabPanel>
        <TabPanel value={value} index={1}>
          {isAuthenticated && <TradeSummary />}
        </TabPanel>
        <TabPanel value={value} index={2}>
          {isAuthenticated && <VolatilityAnalysis />}
        </TabPanel>
        <TabPanel value={value} index={3}>
          {isAuthenticated && <StrategyBuilder />}
        </TabPanel>
        <TabPanel value={value} index={4}>
          <Container maxWidth="sm">
            <Box sx={{ mt: 4, p: 3, bgcolor: 'background.paper', borderRadius: 1 }}>
              <Typography variant="h5" gutterBottom align="center">
                Access Token
              </Typography>
              <AccessTokenInput />
            </Box>
          </Container>
        </TabPanel>
      </Box>
    </Box>
  );
}

const App: React.FC = () => {
  return (
    <Provider store={store}>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <AppContent />
      </ThemeProvider>
    </Provider>
  );
};

export default App;
